import axios from "axios";
import { ref } from "vue";

export default async function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = async () => {
    const apiData = ref();

    const response = await fetch(apiUrl+"calendar/week")
      .then(res => res.json()).then(resJson => {
      apiData.value = resJson;
    });

    return apiData.value;
  }
  apiData.value = await apiCall();

  return {
    apiData
  }
}
